@mayuri30 says - When I was scripting the narrative for @iskconbangalore ’s Janamashtami celebrations, Krishna Katha, it was important to me to tell the story with authenticity. So, I worked with the company dancers at @nritarutya where each of them responded authentically to the script and story with their own movements. In some ways, these sections are my favorite, as they are a creative collaboration that are as authentic, honest, and simple as Krishna’s wisdom itself.

